import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import { GoogleOAuthProvider } from '@react-oauth/google';
import { jwtDecode } from 'jwt-decode';

import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';

import Login from './components/Login';
import Dashboard from './components/Dashboard';
import PlantList from './components/PlantList';
import GardenLogs from './components/GardenLogs';
import GardenCanvas from './components/GardenCanvas';
import { UserContext } from './contexts/UserContext';

const theme = createTheme({
  palette: {
    primary: {
      main: '#4caf50', // Green theme for gardening
      light: '#81c784',
      dark: '#388e3c',
    },
    secondary: {
      main: '#8bc34a',
      light: '#aed581',
      dark: '#689f38',
    },
    background: {
      default: '#f1f8e9',
    },
  },
  typography: {
    h1: {
      fontFamily: '"Roboto", "Helvetica", "Arial", sans-serif',
      fontWeight: 500,
    },
  },
});

function App() {
  const [user, setUser] = useState(null);
  const [token, setToken] = useState(localStorage.getItem('authToken'));

  useEffect(() => {
    if (token) {
      try {
        const decoded = jwtDecode(token);
        const currentTime = Date.now() / 1000;

        if (decoded.exp > currentTime) {
          setUser(decoded);
        } else {
          // Token expired
          localStorage.removeItem('authToken');
          setToken(null);
        }
      } catch (error) {
        console.error('Invalid token:', error);
        localStorage.removeItem('authToken');
        setToken(null);
      }
    }
  }, [token]);

  const handleLogin = (googleToken) => {
    localStorage.setItem('authToken', googleToken);
    setToken(googleToken);
  };

  const handleLogout = () => {
    localStorage.removeItem('authToken');
    setToken(null);
    setUser(null);
  };

  return (
    <GoogleOAuthProvider clientId={process.env.REACT_APP_GOOGLE_CLIENT_ID}>
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <UserContext.Provider value={{ user, token }}>
          <Router>
            <Box sx={{ flexGrow: 1 }}>
              <AppBar position="static">
                <Toolbar>
                  <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                    ðŸŒ± Horti - Your Garden Companion
                  </Typography>
                  {user && (
                    <>
                      <Typography variant="body2" sx={{ mr: 2 }}>
                        Welcome, {user.name || user.email}
                      </Typography>
                      <Button color="inherit" onClick={handleLogout}>
                        Logout
                      </Button>
                    </>
                  )}
                </Toolbar>
              </AppBar>

              <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
                <Routes>
                  <Route 
                    path="/login" 
                    element={!user ? <Login onLogin={handleLogin} /> : <Navigate to="/" />} 
                  />
                  <Route 
                    path="/" 
                    element={user ? <Dashboard /> : <Navigate to="/login" />} 
                  />
                  <Route 
                    path="/canvas" 
                    element={user ? <GardenCanvas /> : <Navigate to="/login" />} 
                  />
                  <Route 
                    path="/plants" 
                    element={user ? <PlantList /> : <Navigate to="/login" />} 
                  />
                  <Route 
                    path="/logs" 
                    element={user ? <GardenLogs /> : <Navigate to="/login" />} 
                  />
                </Routes>
              </Container>
            </Box>
          </Router>
        </UserContext.Provider>
      </ThemeProvider>
    </GoogleOAuthProvider>
  );
}

export default App;
